import React from "react";
import { FaCheckCircle } from "react-icons/fa";
import "../css/Progress.css";

import { MdArrowForwardIos } from "react-icons/md";

const Progress = ({ frame }) => {

  const progressHeaders = [
    'Upload', 'Match', 'Review', 'Comp'
  ]

  return (
    <div className="progress">
      <div className={`progress-item ${frame === "Match" || frame==="Review" && "completed"}`}>
        <FaCheckCircle
          className={`check-icon ${frame === "Match" || frame==="Review" ? "completed" : "invis"}`}
        />
        <h3 style={{ color: frame === "Upload" && "#333" }}>Upload</h3>
        <MdArrowForwardIos className="progress-arrow" />
      </div>
      <div className="progress-item">
        <FaCheckCircle
          className={`check-icon ${frame === "Review" ? "completed" : "invis"}`}
        />
        <h3 style={{ color: frame === "Match" && "#333" }}>Match</h3>
        <MdArrowForwardIos
          className="progress-arrow"
          style={{ color: frame === "Match" && "#333" }}
        />
      </div>
      <div className="progress-item">
        <FaCheckCircle
          className={`check-icon ${
            frame === "Completed" ? "completed" : "invis"
          }`}
        />
        <h3>Review</h3>
        <MdArrowForwardIos className="progress-arrow" />
      </div>
      <div className="progress-item">
        <FaCheckCircle
          className={`check-icon ${
            frame === "Completed" ? "completed" : "invis"
          }`}
        />
        <h3>Complete</h3>
      </div>
    </div>
  );
};

export default Progress;
